const App = () => {
  const course = 'Half Stack application development'
  const part1 = 'Fundamentals of React'
  const exercises1 = 10
  const part2 = 'Using props to pass data'
  const exercises2 = 7
  const part3 = 'State of a component'
  const exercises3 = 14

  return (
    <div>
      <Header course={course} />
      <Content part1 = {part1} ex1={exercises1} part2={part2} ex2={exercises2} part3={part3} ex3={exercises3}/>
      <Total sum={exercises1+exercises2+exercises3} />
    </div>
  )
}

const Header = (props) => {
  return (
    <div>
      <h1>{props.course}</h1>
    </div>
  )
}

const Part = (props) => {
  return (
    <div>
      <p>
        {props.name}
      </p>
    </div>
  )
}

const Content = (props) => {
  return (
    <div>
        <Part>name = {props.part1} count={props.exercises1}</Part>
        <Part>name = {props.part2} count=exercises2</Part>
        <Part>name = {props.part3} count=exercises3</Part>
    </div>
  )
}

const Total = (props) => {
  return (
    <div>
      <p>
        Number of exercises {props.sum}
      </p>
    </div>
  )
}

export default App
